    subplot(6,4,4); %[output:5cb20471]
    ylim([1.9 2.3]); %[output:5cb20471]

    subplot(6,4,5); %[output:5cb20471]
    ylim([-3.8 0]); %[output:5cb20471]

    subplot(6,4,6); %[output:5cb20471]
    ylim([1 2.5]); %[output:5cb20471]

    subplot(6,4,7); %[output:5cb20471]
    ylim([0 0.2]); %[output:5cb20471]

    subplot(6,4,8); %[output:5cb20471]
    ylim([-0.3 0]); %[output:5cb20471]

    subplot(6,4,9); %[output:5cb20471]
    ylim([-1.9 0]); %[output:5cb20471]

    subplot(6,4,10); %[output:5cb20471]
    ylim([0 1.8]); %[output:5cb20471]

    subplot(6,4,11); %[output:5cb20471]
    ylim([-13 -2]); %[output:5cb20471]

