    subplot(6,4,14); %[output:5cb20471]
    ylim([0 1.7]); %[output:5cb20471]

    subplot(6,4,15); %[output:5cb20471]
    ylim([-2.9 -2.49]); %[output:5cb20471]

    subplot(6,4,16); %[output:5cb20471]
    ylim([-2.1 0]); %[output:5cb20471]

    subplot(6,4,17); %[output:5cb20471]
    ylim([-1.2 0]); %[output:5cb20471]

    subplot(6,4,18); %[output:5cb20471]
    ylim([-13.7 -11.4]); %[output:5cb20471]

    subplot(6,4,19); %[output:5cb20471]
    ylim([0 0.27]); %[output:5cb20471]

    subplot(6,4,20); %[output:5cb20471]
    ylim([0.02 0.11]); %[output:5cb20471]

    subplot(6,4,21); %[output:5cb20471]
    ylim([0 7]); %[output:5cb20471]

    subplot(6,4,22); %[output:5cb20471]
    ylim([139.8 140.8]); %[output:5cb20471]

    subplot(6,4,23); %[output:5cb20471]
    ylim([4.3 5.2]); %[output:5cb20471]

    subplot(6,4,24); %[output:5cb20471]
    ylim([29.92 30.02]); %[output:5cb20471]
end %[output:group:5274bc6f]




fprintf('仿真完成！\n'); %[output:9753a932]

toc; %[output:4111188a]

%%
%[text] figure 1 healthy mouse (disease=0) & unhealthy mouse (disease=1)
figure; %[output:98575ecb]

t=t_results{end};
Vm_mV=results{end}.Vm;
Jhv=light_intensities(end);
cGMP=results{end}.cGMP;
pOpen_CNG=cal_pOpen_CNG(results{end});

stimulus = zeros(length(t), 1);

for i = 1:length(t)
    if t(i) >= params.flash_start && t(i) <= (params.flash_start + params.flash_duration)
        stimulus(i) = Jhv * 0.43 ;
    end
end

set(gcf, 'Position', [100, 100, 1600, 900]); %[output:98575ecb]

subplot(4,1,1); %[output:98575ecb]
plot(t,stimulus); % 改变线的粗细 %[output:98575ecb]
title('Light Intensity'); %[output:98575ecb]
xlabel('t(s)'); %[output:98575ecb]
ylabel('Jhv*0.43 (photons/μm²/s)'); %[output:98575ecb]

subplot(4,1,2); %[output:98575ecb]
plot(t,cGMP); %[output:98575ecb]
xlabel('t(s)'); %[output:98575ecb]
ylabel('cGMP (μM)'); %[output:98575ecb]

subplot(4,1,3); %[output:98575ecb]
plot(t,pOpen_CNG); %[output:98575ecb]
